﻿Annotation displays "T"  for any Full-Size-Trolley, "HT" for any Half-Size-Trolley  and "W" for any Waste-Trolley.  0TrueAnnotationGalleyEquipment//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
	there is a GalleyEquipment Trolley where 
	 	(  Trolley.IsOfCategory(Methods.Const.Category_Waste) 
		|| Trolley.IsOfCategory(Methods.Const.Category_FST)
		|| Trolley.IsOfCategory(Methods.Const.Category_HST)
		);
		
THEN
	
	var text = " ";
	var legend = " ";
	var relPos = new Point3D(0, 0, 0);
	var fontH = 100;
	
//	General
	if (Trolley.IsOfCategory(Methods.Const.Category_FST))
	{
		text = "T";
		legend = "Full Size Trolley";
	 	relPos = new Point3D(0.2, 0.5, 0);
	}
	if (Trolley.IsOfCategory(Methods.Const.Category_HST))
	{
		text = "HT"; 
