﻿Displays the recline and breakover situation as annotation on the seat.
"No Recline/No Breakover" -> "NB"
"Limited Recline/No Breakover" -> "LN"
"No Recline" -> "NR"
"Limited Recline" -> "LR"
"No Breakover" -> "NB"0TrueAnnotationPAXSeatReclineBreakover//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
	there is a PAXSeat paxseat;
	there is a SingleSeat singleseat where singleseat.IsChildOf(paxseat) && (singleseat.NoRecline || singleseat.NoBreakover || System.Math.Abs(paxseat.MaxRecline-singleseat.Recline ) > 0.001);		//Check if seat has full recline and breakover
	 
	
THEN  
	
	var number = paxseat.Abreast.ToString();
	var text = " ";
	var legend = "";
	
	if (singleseat.NoRecline && singleseat.NoBreakover)
		{
		text = "RB";
		legend = "No Recline/No Breakover";
		}
	else if (singleseat.NoBreakover && singleseat.Recline != paxseat.MaxRecline)
		{
		text = "LN";
		legend = "Limited Recline/No Breakover";
		}
	else if (singleseat.NoRecline)
		{
		text = "NR";
		legend = "No Recline";
		}
	else if (singleseat.Recline != paxseat.MaxRecline)
		{
		text = "LR";
		legend = "Limited Recline";
		}
	else
		{
		text = "NB";
		legend = "No Breakover";
		};
	
	var rely = (double)(((singleseat.SeatNumber-1)*2)+1)/(2*paxseat.Abreast); // relative y position dependend on singleseat number
	var relx = 0.8;
	var relPos = new Point3D(relx, rely, 0);
	var fontH =150;
	
	justify new RulableAnnotation (paxseat, text, legendText: legend, relativePosition:relPos, fontHeight: fontH, angle: 90);

