﻿This rule creates an error when an item intersects with the Cross Aisle.0TrueCheckCrossAisleASI//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
	there is a CrossAisle crossAisle;  																		
	let deckId = crossAisle.GetDeckId();
	let crossAisleGeom=crossAisle.GetCheckGeometry(CheckGeometryType.CrossAisles);				//get the CrossAisle check geometry
	there is a GeometricItem geomItem where
		geomItem.GetDeckId().Equals(deckId) &&															//check if geomItem is on the same Deck as the CrossAisle
		IntersectionExtensions.IsRelevantForIntersection(geomItem) &&									// exclide irrelevant item types
		geomItem.GetCheckGeometry(CheckGeometryType.Model).Intersects(crossAisleGeom) 		//display error only in cases there is no CrossAisle intersection already
THEN
	justify new RuleFault {
    							Text=string.Format(CultureInfo.InvariantCulture, "{0} and {1} are colliding!",
								new ItemLink("Cross Aisle", crossAisle),
								new ItemLink(geomItem.GetType().Name, geomItem))	
    							};
	if (geomItem is PAXSeat)
		__justify(new Methods.ASI.ASIHint((PAXSeat)geomItem, Methods.ASI.ASIHint.Hint.MoveBack));

﻿This rules checks if a pax seat extends more than 1.5" into cross aisle after post crash deformation.
0TrueCheckPAXSeatCrossAisleASI//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF 
	there is a CrossAisle crossAisle;  																				//limit check to CrossAisle
	let seatDeformation = 3;																						//define the maximum post crash deformation in x value [inch] of the PAXSeat
	let allowedProtrusion = 1.5; 																					//allowed protrusion in x of the CrossAisle [inch]
	let deckId = crossAisle.GetDeckId();
	let instSide = crossAisle.InstallationSide;
	let crossAisleGeom=crossAisle.GetCheckGeometry(CheckGeometryType.CrossAisles);							//get the CrossAisle check geometry
	there is a PAXSeat pax where
		pax.GetDeckId().Equals(deckId) && pax.InstallationSide == instSide &&									//check if there is a PAXSeat on the same Deck and installation side as the CrossAisle
		!pax.GetCheckGeometry(CheckGeometryType.Model).Intersects(crossAisleGeom) &&						//display error only in cases there is no CrossAisle intersection already
    		pax.GetCheckGeometry(CheckGeometryType.Model).Transformed(new Transform3D(Matrix3D.Identity, new Point3D(-(seatDeformation-allowedProtrusion)*25.4,0,0))).Intersects(crossAisleGeom);		//and check if the PAXSeat protrudes more than allowed (with its deformed geometry after a crash) into the PassageWay
THEN
    	justify new RuleFault { Text="The allowed protrusion of deformed "+new ItemLink("PAXSeat", pax)+" into " +new ItemLink("CrossAisle", crossAisle) + " at is not observed!" };
    	justify new Methods.ASI.ASIHint(pax, Methods.ASI.ASIHint.Hint.MoveBack);

﻿This rule validates the EE Cabin Item Constraints.0TrueCheckEE//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF 
	let ca = select CertificationAuthority;
    	let oc = select OperationalCondition;
	there is a EECabinItemConstraint constraint;
	there is a OptionContainer optCont where optCont.Type == "EE" && optCont.SlotName.Equals(constraint.EEContainer);
    	assume constraint.Matches(ca, oc);
    	let matchingItems = select CatalogItem item where constraint.Matches(item) && item.GetDeckId() == optCont.GetDeckId();
    	assume matchingItems.Any();
THEN
    	justify new EERequirement(constraint.EEContainer, constraint.EECategory, constraint.GroupId, constraint.MinAmount * matchingItems.Count());

﻿This rule validates the EE Parameter Constraints deck wise.0TrueCheckEE//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
	let ca = select CertificationAuthority;
    	let oc = select OperationalCondition;
    	there is a EEParameterConstraint constraint;
    	assume constraint.Matches(ca, oc);
    	there is a Layout layout;
	    there is a OptionContainer optCont where optCont.Type == "EE" && optCont.SlotName.Equals(constraint.EEContainer);
    	there is a Statistics deckStatistics where deckStatistics.ParentId.Equals(optCont.GetDeckId());
		there is a Statistics layoutStatistics where layoutStatistics.ParentId.Equals(layout.UniqueId);
    	let parameterValue = constraint.GetValue(layout, layoutStatistics.ItemStatistics, deckStatistics.ItemStatistics);
    	assume parameterValue.HasValue && parameterValue.Value >= constraint.MinValue && parameterValue.Value <= constraint.MaxValue;
THEN
	justify new EERequirement(constraint.EEContainer, constraint.EECategory, constraint.GroupId, 
    		(constraint.QuantityMultiplier ? parameterValue.Value : 1) * constraint.MinAmount);

