﻿This rule validates the EE Requirement Constraints.0TrueCheckEE//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF 
    	let ca = select CertificationAuthority;
    	let oc = select OperationalCondition;
	there is a EERequirementConstraint constraint;
    	assume constraint.Matches(ca, oc);
	let requirements=select EERequirement requirement
		where constraint.DependentEECategory == requirement.EeCategory && constraint.EEContainer == requirement.Container;
	assume requirements.Any();
THEN
	justify new EERequirement(constraint.EEContainer, constraint.EECategory, constraint.GroupId, constraint.MinAmount * requirements.Sum(r=>r.Amount));

﻿This rule checks the collision between PAXSeats and escape hatch zones.0TrueCheckASIEscapeHatchPAXSeat//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
