IF
	there is a Zone zone where zone.ZoneType == Methods.ZoneTypes.EscapeHatch;
	let bbox = zone.AbsoluteBoundingBox;
	let deckId = zone.GetDeckId();
	there is a PAXSeat pax where pax.GetDeckId() == deckId && pax.AbsoluteBoundingBox.IntersectsXY(bbox);
THEN
	justify new RuleFault {Text=new ItemLink("Escape hatch", zone)+" is covered by "+new ItemLink("PAX seat", pax) + "!"};
	justify new Methods.ASI.ASIHint(pax, Methods.ASI.ASIHint.Hint.EscapeHatch);

﻿This rule checks if a fixed shell PAXSeatadheres the required distance to a Monument0TrueCheckPAXSeat//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
	there is a GeometricItem monument where monument is Monument;
	there is a PAXSeat fixedShellSeat where fixedShellSeat.IsCocoonSeat == true
		&& fixedShellSeat.AbsoluteBoundingBox.XMin > monument.AbsoluteBoundingBox.XMax
		&& fixedShellSeat.InstallationSide == monument.InstallationSide
		&& fixedShellSeat.GetDeckId() == monument.GetDeckId()
		&& monument.GetCheckGeometry(CheckGeometryType.Model).Intersects(fixedShellSeat.GetCheckGeometry(CheckGeometryType.Model).Transformed(new Point3D(-fixedShellSeat.ForwardInstallDistance , 0, 0)));
	
THEN
	justify new RuleFault
	{
	Text=System.String.Format(CultureInfo.InvariantCulture, "The minimum distance between {0} and {1} is not adhered to required distance {2}, current distance {3:0.#}!",
	new ItemLink(monument.GetType().Name, monument),
	new ItemLink("PAXSeat", fixedShellSeat),
	fixedShellSeat.ForwardInstallDistance,
	(fixedShellSeat.AbsoluteBoundingBox.XMin - monument.AbsoluteBoundingBox.XMax))
	};

﻿This rules checks if the front assist space has 
been violated by any cabin item.0TrueCheckAssistSpaceASI//////////////////////////////////////////////////////////////////////////////
