    	there is a Door door where
    		(item.InstallationSide.Equals(InstallationSide.All) || door.InstallationSide.Equals(item.InstallationSide)) && //make sure items are on the same inst. side
    		door.GetDeckId().Equals(item.GetDeckId()) && //make sure items are on the same deck
