    			new ItemLink(door.GetType().Name, door))
    	};
	if(item is PAXSeat)
	    		__justify(new Methods.ASI.ASIHint((PAXSeat)item, Methods.ASI.ASIHint.Hint.SwitchSeat));

﻿Creates an error when an item is not inside the BBox of the deck.0TrueCheckASI//////////////////////////////////////////////////////////////////////////////
