﻿Creates an error when two items are colliding.0TrueCheckPAXSeatASI//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF 
	there is a GeometricItem g1 where IntersectionExtensions.IsRelevantForIntersection(g1); //exclude non applicable geometric items
    let geom1 = g1.GetCheckGeometry(CheckGeometryType.Model);
	let deckId = g1.GetDeckId();
	there is a GeometricItem g2 where IntersectionExtensions.IsRelevantForIntersection(g2) //exclude non applicable geometric items
    		&& g2.UniqueId.CompareTo(g1.UniqueId) < 0 //make sure to check only in one direction
    		&& g2.GetDeckId().Equals(deckId) // make sure items are on same deck
    		&& g2.GetCheckGeometry(CheckGeometryType.Model).Intersects(geom1); // check for intersection
   THEN
  	justify new RuleFault{
    		Text=System.String.Format("{0} and {1} are colliding.", 
    			new ItemLink(g1.GetType().Name, g1),
			new ItemLink(g2.GetType().Name, g2))};
    	if(g1 is PAXSeat)
    		__justify(new Methods.ASI.ASIHint((PAXSeat)g1, Methods.ASI.ASIHint.Hint.MoveBack));
    	if(g2 is PAXSeat)
		__justify(new Methods.ASI.ASIHint((PAXSeat)g2, Methods.ASI.ASIHint.Hint.MoveBack));

﻿Check if the single bladed Lavatory door can be opened.0TrueCheckLavatoryDoor//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////	

IF 
	
    	there is a Deck deck;
	
	there is a Lavatory lavatory where
		lavatory.IsChildOf(deck);																//limit check to lavatories
    
	there is a Equipment equipment where 
			equipment.IsChildOf(lavatory) 													//limit check to equipment that is child of the lavatory
    		&& (	equipment.IsOfCategory(Methods.Const.Category_SingleBlade_LH) 		//and that is an single blade door 
    			|| 	equipment.IsOfCategory(Methods.Const.Category_SingleBlade_RH) 
			); 
    
	there is a GeometricItem geometricItem where 											//limit check to a geometric item 
       		(geometricItem is Galley || geometricItem is Lavatory || geometricItem is  Stowage || geometricItem is Partition || geometricItem is CAS || geometricItem is PAXSeat || geometricItem is Stairhouse || geometricItem is Stair || geometricItem is Lift || geometricItem is CRC)			//and that is relevant for this check (no seatrails, no windows, ...)
       	&& geometricItem.UniqueId != lavatory.UniqueId									//and is not itself
		&& geometricItem.IsChildOf(deck);									
     
	let door90intersection = geometricItem.GetCheckGeometry(CheckGeometryType.Model).Intersects(lavatory.GetCheckGeometry(CheckGeometryType.Door90));			//check intersection with the 90° door of the lavatory
    
	let door180intersection = geometricItem.GetCheckGeometry(CheckGeometryType.Model).Intersects(lavatory.GetCheckGeometry(CheckGeometryType.Door180));		//check intersection with the 180° door of the lavatory

	assume door90intersection || door180intersection;

THEN

	justify new RuleFault
	    {
	    	Category = door90intersection ? RuleFault.FaultCategory.Error : RuleFault.FaultCategory.Warning,
	    	Text= door90intersection 
	    		?  new ItemLink(lavatory.GetType().Name, lavatory) + " is not accessible due to blocked door by the " + new ItemLink(geometricItem.GetType().Name ,geometricItem)+ "!"
	    		:  "Door opening of this " + new ItemLink(lavatory.GetType().Name, lavatory) + " has to be limited not to clash with another " + new ItemLink(geometricItem.GetType().Name ,geometricItem) + "!" +door90intersection
	    };

﻿This rules checks if a pax seat in maximum
break over position conflicts with a cross 
aisle.

FAA 25.813.0TrueCheckCrossAislePAXSeatMax BreakoverASI//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
    	//get a Cross Aisle
	there is a CrossAisle crossAisle;
	let deckId = crossAisle.GetDeckId();
    
    	//get a PAXSeat in center position, on the same installation side, which is located behind the Cross Aisle
    	there is a PAXSeat pax where 
    		pax.InstallationSide.Equals(InstallationSide.CTR) && //make sure seat is installed at the center position
    		pax.GetDeckId().Equals(deckId) && //make sure items are on the same deck
    		pax.AbsoluteBoundingBox.XMin >= crossAisle.AbsoluteBoundingBox.XMax; //make sure pax is located behind CA
    
    	//get breakover check geometry
    	let breakover = pax.GetCheckGeometry(CheckGeometryType.Breakover);
    
    	//make intersection test between CA and breakover geometry
    	assume
    		crossAisle.GetCheckGeometry(CheckGeometryType.Model).Intersects(breakover);
    	
THEN
	justify new RuleFault{
    		Text = string.Format(CultureInfo.InvariantCulture,
    			"{0} intersects {1} with its maximum Breakover!",
    			new ItemLink(pax.GetType().Name, pax),
    			new ItemLink(crossAisle.GetType().Name, crossAisle))
    	};
	
	justify new Methods.ASI.ASIHint(pax, Methods.ASI.ASIHint.Hint.MoveBack);

