﻿Checks if the current Pitch is above the defined maximum.0TrueCheckPAXSeat//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF 
    there is a PAXSeat fwdBench;
    let fwdBenchAbsX = fwdBench.AbsolutePosition.X;
    let deckId = fwdBench.GetDeckId();
    let instSide = fwdBench.InstallationSide;
    there is a PAXSeat aftBench where aftBench.GetDeckId() == deckId //make sure fwd and aft bench are on same deck
    		&& aftBench.InstallationSide == instSide //make sure fwd and aft bench are on same installation side
    		&& aftBench.AbsolutePosition.X > fwdBench.AbsolutePosition.X    //define order of benches
		&& (aftBench.AbsolutePosition.X -  fwdBench.AbsolutePosition.X) > aftBench.MaxPitch; // early break if distance is to large
   	
    let distance = (fwdBench.AbsoluteTransform * fwdBench.SeatLegs.First().Fwd).GetDistance((aftBench.AbsoluteTransform * aftBench.SeatLegs.First().Fwd));
    let aftBenchAbsX = aftBench.AbsolutePosition.X;
    assume distance > aftBench.MaxPitch + 0.01; //check distance between studs taking an accurancy of 0.01 into account
   there is no GeometricItem item where 	(item is PAXSeat || item is Galley || item is Lavatory || item is  Stowage || item is Partition || item is CAS || item is CrossAisle || item is Door) // define breaking elements
    		&& item.UniqueId != aftBench.UniqueId && item.UniqueId != fwdBench.UniqueId // make sure the two seat are succeeding
		&& item.GetDeckId() == deckId // no breaking element on same deck
    		&& item.InstallationSide == instSide // no breaking element on same installation side
		&& item.AbsolutePosition.X.Between(fwdBenchAbsX, aftBenchAbsX);
  THEN
    justify new RuleFault
    {
    Text=string.Format(System.Globalization.CultureInfo.InvariantCulture,
		"The maximum allowd pitch ({0:0.#}) between {1} and {2} is exceeded ({3:0.#}).",
		aftBench.MaxPitch/25.4,    
    		new ItemLink("seat 1", fwdBench),
    		new ItemLink("seat2", aftBench),
    		distance/25.4)
    };

﻿This rule raises an error when there are less than 1 CAS per 50 PAX in one deck.0TrueCheckCAS//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF 
    there is a Deck deck; // check per deck
    let numberOfSingleCas = select CAS cas where cas.GetDeckId() == deck.UniqueId && cas.NumberOfAttendants == 1;  // get all single CAS on that deck
    let numberOfDoubleCas = select CAS cas where cas.GetDeckId() == deck.UniqueId && cas.NumberOfAttendants == 2;  // get all double CAS on that deck
    let numberOfPax = select SingleSeat pax where pax.GetDeckId() == deck.UniqueId; // get all single seats on that deck
    assume numberOfSingleCas.Count() + numberOfDoubleCas.Count()*2< System.Math.Ceiling(numberOfPax.Count()/50.0);    //calculate if the number of attendents is less than number of single seats divided by 50 (round up to next integer)

  THEN
    justify new RuleFault
    {
    Text = "Minimum number of CAS in " + deck.Name + " not reached. Expected " + System.Math.Ceiling(numberOfPax.Count()/50.0) + " actual " + (numberOfSingleCas.Count() + numberOfDoubleCas.Count()*2)
    };

﻿Checks if the current Pitch is below the defined minimum.0TrueCheckPAXSeat//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////
		
IF
    there is a PAXSeat fwdBench;
	let fwdBenchX = fwdBench.AbsolutePosition.X;
    let deckId = fwdBench.GetDeckId();
    let installSide = fwdBench.InstallationSide;  

    there is a PAXSeat aftBench where aftBench.GetDeckId() ==deckId //make sure fwd and aft bench are on same deck
    		&& aftBench.InstallationSide ==installSide //make sure fwd and aft bench are on same installation side
    		&& aftBench.AbsolutePosition.X > fwdBenchX;    //define order of benches
	
    let distance = (fwdBench.AbsoluteTransform * fwdBench.SeatLegs.First().Fwd).GetDistance((aftBench.AbsoluteTransform * aftBench.SeatLegs.First().Fwd));
    let aftBenchX = aftBench.AbsolutePosition.X;
    assume distance < aftBench.MinPitch - 0.01; //check distance between studs taking an accurancy of 0.01 into account
    there is no GeometricItem item where
		(item is PAXSeat || item is Galley || item is Lavatory || item is  Stowage || item is Partition || item is CAS) // define breaking elements
	       && item.InstallationSide == installSide // no breaking element on same installation side
    		&& item.GetDeckId() == deckId // no breaking element on same deck
    		&& item.AbsolutePosition.X > fwdBenchX // no breaking element between Fwd and aft seat
    		&& item.AbsolutePosition.X < aftBenchX; // no breaking element between Fwd and aft seat
	
THEN
    justify new RuleFault
    {
    Text=string.Format(System.Globalization.CultureInfo.InvariantCulture,
		"The minimum allowd pitch ({0:0.#}) between {1} and {2} is not adhered to ({3:0.#}).",
		aftBench.MinPitch/25.4,    
    		new ItemLink("seat 1", fwdBench),
    		new ItemLink("seat2", aftBench),
    		distance/25.4)
    };

