﻿Check if the gap between two monuments matches the minimum distance of 1 inch.0TrueCheckMonument//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF 
    	let gap = 25.4 - 0.01;
	let filter = (System.Func<GeometricItem, bool>)(item => item is Stowage || item is Galley || item is Partition || item is Lavatory);

	//get relevant item 1
	there is a GeometricItem item1 where filter(item1);
	let instSide = item1.InstallationSide;
	let deckId = item1.GetDeckId();
	//get the check geometries and define failure distance
    	let item1geom = item1.GetCheckGeometry(CheckGeometryType.Model);
    
    	//get relevant item 2
    	there is a GeometricItem item2 where
		filter(item2) &&
		item1.UniqueId.CompareTo(item2.UniqueId) < 0 &&
    		item2.GetDeckId().Equals(deckId) && //make sure items are in the same deck
    		item2.InstallationSide.Equals(instSide); //make sure items are on the same installation side

    	let item2geom = item2.GetCheckGeometry(CheckGeometryType.Model);
    	
    	//check for minimum distance between the two items via a transformed check geometry intersection test
    	assume
    		!item1geom.Intersects(item2geom) && //make sure that the items don't intersect without any translation
    		(	item1geom.Intersects(item2geom.Transformed(new Point3D(gap,0,0))) //translated in +x
    		||	item1geom.Intersects(item2geom.Transformed(new Point3D(-gap,0,0)))); //translated in -x
	
THEN
	justify
    	new RuleFault {
    		Text = string.Format(CultureInfo.InvariantCulture,
    			"Gap between {0} and {1} is too small. One inch is required at minimum",
    			new ItemLink(item1.GetType().Name, item1),
    			new ItemLink(item2.GetType().Name, item2))
    	};

