﻿Check if there is enough space (20mm)
behind a reclined pax.

AN64.0TrueCheckPAXSeatReclineASI//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
    	//look for an item that is not a pax seat
	there is a GeometricItem item where
    		IntersectionExtensions.IsRelevantForIntersection(item) &&
    		!(item is PAXSeat);
    let deckId = item.GetDeckId();
	let instSide = item.InstallationSide;
	
    	//look for a pax seat
    	there is a PAXSeat pax where
    		pax.GetDeckId().Equals(deckId) && //make sure seats are on the same deck
    		pax.InstallationSide.Equals(instSide);	//make sure seats are on the same inst. side 
    
    	//get check geometries
    	let itemGeom = item.GetCheckGeometry(CheckGeometryType.Model);
    	let paxReclineGeom = pax.GetCheckGeometry(CheckGeometryType.Recline);
    
    	//Do intersection tests
    	assume
    		!itemGeom.Intersects(pax.GetCheckGeometry(CheckGeometryType.Model))
    		&&	!itemGeom.Intersects(paxReclineGeom) 
    		&&	(	itemGeom.Intersects(paxReclineGeom.Transformed(new Point3D(20,0,0))) //check for 20mm space in +x
    			||	itemGeom.Intersects(paxReclineGeom.Transformed(new Point3D(-20,0,0)))); //check for 20mm space in -x
THEN
	justify
    	new RuleFault {
    		Text = string.Format(CultureInfo.InvariantCulture,
    			"{0} is closer than 20mm behind reclined {1}!",
    			new ItemLink(item.GetType().Name, item),
    			new ItemLink(pax.GetType().Name, pax))
    	};
