﻿Check if a cabin item is closer than 20mm 
to pax seat.

AN64.0TrueCheckPAXSeatASI//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
    	//look for an item that is nopax seat
	there is a GeometricItem item where
    		IntersectionExtensions.IsRelevantForIntersection(item) &&
    		!(item is PAXSeat);
    let deckId = item.GetDeckId();
	
    	//look fo a pax seat on the same deck
    	there is a PAXSeat pax where
    		pax.GetDeckId().Equals(deckId);
    
    	//get check geometries
    	let itemGeom = item.GetCheckGeometry(CheckGeometryType.Model);
    	let paxGeom = pax.GetCheckGeometry(CheckGeometryType.Model);
    
    	//Do 20mm check in x and y (+/-)
    	assume
    		!itemGeom.Intersects(paxGeom) 
    		&&	(	itemGeom.Intersects(paxGeom.Transformed(new Point3D(20,0,0))) 
    			||	itemGeom.Intersects(paxGeom.Transformed(new Point3D(-20,0,0)))
    			||	itemGeom.Intersects(paxGeom.Transformed(new Point3D(0,20,0)))
    			||	itemGeom.Intersects(paxGeom.Transformed(new Point3D(0,-20,0))));
THEN
	justify
    	new RuleFault {
    		Text = string.Format(CultureInfo.InvariantCulture,
    			"{0} is closer than 20mm to {1}!",
    			new ItemLink(item.GetType().Name, item),
    			new ItemLink(pax.GetType().Name, pax))
    	};
	justify new Methods.ASI.ASIHint(pax, Methods.ASI.ASIHint.Hint.MoveBack);

