﻿This rule raises an error when the overlap of cross aisle and passageway is less than required for a 2-way access from front.
Required:
1 inch in case of Type C door
10 inch in case of Type A door0TrueCheckDoorCrossAislePassageway//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
	there is a Door d where d.DoorAccessType == DoorAccessType.TwoWayFromFront;
	there is a DoorAccess da where d.IsChildOf(da); //DoorAccess is needed to retrieve the rating and related door/cross aisle
	there is a CrossAisle ca where ca.IsChildOf(da); //check for existance of cross aile (since rule is valid for twin aisle aircrafts only)
	there is a DoorRating dr where dr.IsChildOf(da); //get related door rating
	let overlap = dr.MinOverlap; //define overlap according to door rating
	assume ca.AbsoluteBoundingBox.XMax - d.PassageWayFront.X < overlap || d.PassageWayRear.X - ca.AbsoluteBoundingBox.XMin < overlap;
	let dags = select DoorAccessGeometryItem dag where dag.IsChildOf(d);
	assume dr.PassageWayModification != PassageWayModificationType.Kink || dags.Any();	// don't check for really kinked door access geometry because this is correct by design
THEN
	var side = d.InstallationSide.Equals(InstallationSide.LH)?"left":"right";
	justify new RuleFault{
	Text="No Proper overlap of " +overlap/25.4+" inch for 2-way front access of "+ side + " "+ new ItemLink("PW", d) + " and " + new ItemLink("CA", ca)
	};

