﻿This rule creates an error when the longitudinal ailse is blocked. Check redruced to items located inside a "CheckZoneTShape" zone. 0TrueCheckASIPAXSeat//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
