IF 
       let tshape = new TShapeParameters()
				   {
					LowerRadius = 15 * 25.4,
					UpperRadius = 20 * 25.4,
					LowerHeight = 25 * 25.4,
					UpperHeight = 1854,
					Offset = 0,
    				};
	
	there is a DeckInfo deck;
	there is a Zone checkZone where checkZone.ZoneType =="CheckZone-TShape" && checkZone.GetDeckId().Equals(deck.UniqueId);
		
