			g1.GetDeckId().Equals(deck.UniqueId)&& g1.AbsolutePosition.X > checkZone.AbsoluteBoundingBox.MinPoint.X && g1.AbsolutePosition.X < checkZone.AbsoluteBoundingBox.MaxPoint.X;
	there is a GeometricItem g2 where
			g2.GetDeckId().Equals(deck.UniqueId) &&
    		TShapeCollisionCheck.IsRelevantForTShapeCollision(g2) &&
    		g2.UniqueId.CompareTo(g1.UniqueId) < 0 &&
    		g2.AbsoluteBoundingBox.XMax > g1.AbsoluteBoundingBox.XMin - 2000 &&
            	g2.AbsoluteBoundingBox.XMin < g1.AbsoluteBoundingBox.XMax + 2000 &&
    		g1.InstallationSide != g2.InstallationSide;
	assume TShapeCollisionCheck.HaveCollision(g1, g2, tshape, deck);
    
   THEN
  	justify new RuleFault{
    		Text=System.String.Format("{0} and {1} violate T-Shape collision {2}.", 
    			new ItemLink(g1.GetType().Name, g1),
			new ItemLink(g2.GetType().Name, g2),
			new ItemLink("check",checkZone)	
			)};
	var p = g1 as PAXSeat;
	if(p != null)
    		__justify(new Methods.ASI.ASIHint(p, Methods.ASI.ASIHint.Hint.SwitchSeat));
	p = g2 as PAXSeat;
	if(p != null)
    		__justify(new Methods.ASI.ASIHint(p, Methods.ASI.ASIHint.Hint.SwitchSeat));

