﻿Checks if a PAXSeat is on valid rail position.0TrueCheckASIPAXSeatSeatRails//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////

IF
	let tolerance = 2.5;	
	there is a SeatRails rails;
	there is a PAXSeat seat where seat.GetDeckId() == rails.DeckId;
	let studs = seat.Studs.Select(s => seat.AbsoluteTransform * s);		//collect all studs
	let studBox = studs.ComputeBoundingBox();
	let bbox = new BoundingBox3D(studBox.XMin - tolerance, studBox.XMax + tolerance,
			                            studBox.YMin - tolerance, studBox.YMax + tolerance,
			                            studBox.ZMin - tolerance, studBox.ZMax + tolerance);
	let candidates = rails.GetCandidates(bbox).ToList();
	assume !studs.All(s => candidates.Any(c => c.HasRailMountPoint(s, tolerance)));
THEN
  	justify new RuleFault{ Text=string.Format("{0} is not installed on valid rail position!", new ItemLink("Pax Seat", seat))};
	justify new Methods.ASI.ASIHint(seat, Methods.ASI.ASIHint.Hint.SwitchSeat);

﻿Front Row analysis of PAXSeat; depending on belt type, comfort class, presence of HIC-Geometry and position of the SeatReferencePoint (CRP) of each SingleSeat:  

If a Threepoint or Airbag belt is used, the 35" FAR HeadStrikeRadius (HSR) is considered. 

If a Normal belt is in use, the HeadInjuryCriterion (HIC) is respected by using the attached 3D-HIC-Trajectory per SingleSeat. 

If a Normal belt is used and no 3D-HIC-Trajectory is attached in the seat data, a Setback depending to the comfort class is respected.0TrueCheckHICHSRSetbackPAXSeatASI//////////////////////////////////////////////////////////////////////////////
//																			//
// PACE Aerospace Engineering and Information Technology GmbH		//
// 																			//
// This rule may not be changed! If an edit is necessary, copy this rule.	//	
//																			//
//////////////////////////////////////////////////////////////////////////////	

IF
    	//get a pax seat    
	there is a PAXSeat pax;
	let deckId = pax.GetDeckId();
	let instSide = pax.InstallationSide;
	let paxBBox = pax.AbsoluteBoundingBox;
    
    	//get a monument which is in front of the pax
    	there is a GeometricItem item where 
    		EMB_FrontRowHICCheck.IsRelevantForFrontRowHICCheck(item) &&
    		!(item is PAXSeat) &&
		!( (item is Ancillary) && (item as Ancillary).Category.Equals("BB") ) &&
    		item.GetDeckId().Equals(deckId) &&
    		item.InstallationSide.Equals(instSide) &&
    		item.AbsoluteBoundingBox.XMax < pax.AbsoluteBoundingBox.XMin;
    
    	//be sure, there is no obstacle between pax and monument
    	there is no PAXSeat obstacle where
    		obstacle.GetDeckId().Equals(deckId) &&
    		obstacle.InstallationSide.Equals(instSide) &&
      		obstacle.AbsoluteBoundingBox.XMin > item.AbsoluteBoundingBox.XMax && obstacle.AbsoluteBoundingBox.XMax < paxBBox.XMin &&
    		!(obstacle.AbsoluteBoundingBox.YMax < paxBBox.YMin || paxBBox.YMax < obstacle.AbsoluteBoundingBox.YMin);
      
    	//get all single seats of this paxseat
    	let seats = select SingleSeat seat where seat.IsChildOf(pax);
    	
	//do the front row analysis
    	assume new Methods.Rules.EMB_FrontRowHICCheck(pax, seats, item).CheckFailed;
    		
  THEN
    	var error =  new Methods.Rules.EMB_FrontRowHICCheck(pax, seats, item).Error;
  	justify new RuleFault{
    		Text=System.String.Format(CultureInfo.InvariantCulture,
			"{0}" +error + "{1}", 
    			new ItemLink(pax.GetType().Name, pax),
    			new ItemLink(item.GetType().Name, item))};
	justify new Methods.ASI.ASIHint(pax, Methods.ASI.ASIHint.Hint.MoveBack);

