﻿0TrueEMBRAERCheckASIPAXSeatPassagewayDoor// =======================================================================================================================
//	This Rule extends original PACE rule to check seat "post" deformation protusion
//	interference with passagway
//	WHO					WHEN						WHAT
//	FCN					2016/Nov/25				Initial copy/write
// =======================================================================================================================

IF
    	there is a Door door;
	// 1/4" value from Z2 test, from Linsmayer
	let seatDeformation =(1/4)*25.4;																				//define the maximum post crash deformation in x value [inch] of the PAXSeat
	let allowedProtrusion = 0*25.4; 																				//allowed protrusion in x into the passagway [inch]
	let deckId = door.GetDeckId();
	let instSide = door.InstallationSide;
	let pwCheckGeom=door.GetCheckGeometry(CheckGeometryType.PassageWay);								//get the passagweay check geometry
 	there is a PAXSeat pax where 
	pax.GetDeckId().Equals(deckId) && pax.InstallationSide == instSide && 									//check if there is a PAXSeat on the same Deck and installation side as the PW
 	!pax.GetCheckGeometry(CheckGeometryType.Model).Intersects(pwCheckGeom) &&						//display error only in case there is no PW intersection already
   	pax.GetCheckGeometry(CheckGeometryType.Model).Transformed(new Point3D(-(seatDeformation-allowedProtrusion),0,0)).Intersects(pwCheckGeom);
THEN
	justify new RuleFault {
    	Text="The allowed protrusion of deformed "+new ItemLink("PAXSeat", pax) +" into passageway at " +new ItemLink("Door"+ door.DoorNumber + " ("+instSide+")", door) + " is not observed."
    	};
  	justify new Methods.ASI.ASIHint(pax, Methods.ASI.ASIHint.Hint.MoveBack);

